import React, { Component } from 'react'

class UserRegisterComponent extends Component {
    constructor(props){
        super(props)
        this.state = {
            username: '',
            password: ''
        }
    }
    render() {
        return(
            <h1>Welcome!</h1>
        )
    }

}

export default UserRegisterComponent
